function Button(props) {

  function Start(){
    console.log('Clicked!');

  }
  return (
      <div>
        <div className='card'> 
          <h2> {props.text} </h2>
          <div className='actions'> 
            <button className='btn' onClick={Start}> Start Learning </button>

          </div>

        </div>






      </div>




  );
}

export default Button;
